import React from "react";

export class Nine extends React.Component{
        constructor(props){
            super(props)

            this.state = {

                Name : "cc"
            }
        }
            changeState(){
                this.setState({
                    Name : "bb",
                })
            }

    render(){
        return(
            <div>
                <h1>{this.state.Name}</h1>
                {/* <button onClick= {() => this.changeState()}>press</button> */}
            </div>
        )
    }
}

